import { useEffect, useState } from "react";
import HOST from "../Setup";

function ProfessorDetails(props) {
  const [professorDetails, setProfessorDetails] = useState("aaa");

  useEffect(() => {
    let url = HOST + "/professors/" + props.professor.id;
    fetch(url).then((response) => {
      response.json().then((result) => {
        console.log(response);
        setProfessorDetails(response);
      });
    });
  }, []);

  return (
    <div>
      <h3>{professorDetails.firstname}</h3>
    </div>
  );
}

export default ProfessorDetails;
